import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import { useState, useEffect } from "react";
import Particles, { ISourceOptions } from "react-tsparticles";
import Projects from "./Projects";
import Blog from "./Blog";
import SocialMedia from "./SocialMedia";
import Services from "./Services";
import About from "./About";
import Homepage from "./Homepage";

const styles = {
  app: {
    display: "flex",
    height: "100vh",
    flexDirection: "column",
  },
  header: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "10px 20px",
    backgroundColor: "transparent",
    borderBottom: "1px solid #070505",
    zIndex: 2,
  },
  logo: {
    height: "150px",
    width: "auto",
    marginRight: "2px",
  },
  navLinks: {
    listStyle: "none",
    display: "flex",
    margin: 0,
    padding: 0,
  },
  navItem: {
    marginLeft: "20px",
  },
  navLink: {
    textDecoration: "none",
    color: "#fff",
    fontSize: "16px",
  },
  mainContent: {
    flex: 1,
    padding: "20px",
    overflow: "auto",
    zIndex: 1,
  },
  fullScreenMenu: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    position: "fixed",
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: "black",
    zIndex: 2,
  },
  fullScreenLink: {
    color: "white",
    fontSize: "24px",
    textDecoration: "none",
    padding: "10px",
    margin: "10px 0",
  },
};

const particleOptions: ISourceOptions = {
  background: {
    color: {
      value: "#000000", // Black background
    },
  },
  particles: {
    number: {
      value: 100,
      density: {
        enable: true,
        value_area: 800,
      },
    },
    color: {
      value: "#ffffff", // White stars
    },
    shape: {
      type: "circle",
    },
    opacity: {
      value: 1,
      random: true,
      animation: {
        enable: true,
        speed: 1,
        minimumValue: 0.3,
        sync: false,
      },
    },
    size: {
      value: 2,
      random: true,
      animation: {
        enable: true,
        speed: 2,
        minimumValue: 0.5,
        sync: false,
      },
    },
    move: {
      enable: false, // Static stars
    },
  },
  detectRetina: true,
};

function App() {
  const [isOpen, setIsOpen] = useState(false);
  const [isMobile, setIsMobile] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth <= 800);
    };
    handleResize();
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  useEffect(() => {
    document.body.style.overflow = isOpen ? "hidden" : "auto";
  }, [isOpen]);

  const toggleNav = () => setIsOpen(!isOpen);
  const resetNav = () => setIsOpen(false);

  return (
    <Router>
      {/* Twinkling Stars Background */}
      <Particles
        options={particleOptions}
        style={{
          position: "absolute",
          zIndex: 0,
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
        }}
      />
      <div style={styles.app}>
        <header style={styles.header}>
          <Link to="/">
            <img
              src="/starlightlogo.png"
              alt="Starlight Technology Logo"
              style={styles.logo}
            />
          </Link>
          <nav>
            <ul style={styles.navLinks}>
              <li style={styles.navItem}>
                <Link to="/projects" style={styles.navLink}>
                  Projects
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/blog" style={styles.navLink}>
                  Blog
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/social-media" style={styles.navLink}>
                  Social Media
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/services" style={styles.navLink}>
                  Services
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/about" style={styles.navLink}>
                  About
                </Link>
              </li>
            </ul>
          </nav>
        </header>
        <div style={styles.mainContent}>
          <Routes>
            <Route path="/" element={<Homepage />} />
            <Route path="/projects" element={<Projects />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/social-media" element={<SocialMedia />} />
            <Route path="/services" element={<Services />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
